$("#menu-toggle").click(function (e) {
    e.preventDefault(), $("#wrapper").toggleClass("toggled");
  }),
    (function (e) {
      "use strict";
      var a;
      (a = () => {
        const a = e.querySelector(".dismiss"),
          t = e.querySelector(".sidebar"),
          s = e.querySelector(".overlay"),
          c = e.querySelector(".open-menu");
        t &&
          (a.addEventListener("click", () => {
            t.classList.remove("active"), s.classList.remove("active");
          }),
          s.addEventListener("click", () => {
            t.classList.remove("active"), s.classList.remove("active");
          }),
          c.addEventListener("click", (e) => {
            e.preventDefault(),
              t.classList.add("active"),
              s.classList.add("active");
          }),
          e.querySelector(".nav-link").addEventListener("click", () => {
            t.classList.remove("active"), s.classList.remove("active");
          }));
      }),
        "loading" != e.readyState
          ? a()
          : e.addEventListener("DOMContentLoaded", a);
    })(document),
    jQuery(document).ready(function () {
      $(".dismiss, .overlay").on("click", function () {
        $(".sidebar").removeClass("active"), $(".overlay").removeClass("active");
      }),
        $(".open-menu").on("click", function (e) {
          e.preventDefault(),
            $(".sidebar").addClass("active"),
            $(".overlay").addClass("active"),
            $(".collapse.show").toggleClass("show"),
            $("a[aria-expanded=true]").attr("aria-expanded", "false");
        });
    });
  